import React from "react";

const hosts = (props) => {
    return(
        <div>
            <div>
                <div>
                    <table>
                        <thead>
                        <tr>
                            <th scope={"col"}>Name</th>
                            <th scope={"col"}>Surname</th>
                        </tr>
                        </thead>
                        <body>
                        {props.hosts.map((term) => {
                            return(
                                <tr>
                                    <td>{term.name}</td>
                                    <td>{term.surname}</td>
                                </tr>
                            );
                        })}
                        </body>
                    </table>
                </div>
            </div>
        </div>
    );
}
export default hosts;
